import React from 'react';
import CustomerTable from './CustomerTable';

const customers = [
  { id: 1, name: 'Ahmed Ali', phone: '07501234567' },
  { id: 2, name: 'Sara Karim', phone: '07709876543' },
];

export default function App() {
  const handleView = (customer) => {
    alert('View: ' + customer.name);
  };

  const handleEdit = (customer) => {
    alert('Edit: ' + customer.name);
  };

  const handleDelete = (customer) => {
    if (window.confirm('Are you sure to delete?')) {
      alert('Deleted: ' + customer.name);
    }
  };

  return <CustomerTable customers={customers} onView={handleView} onEdit={handleEdit} onDelete={handleDelete} />;
}
